import React from 'react';
import {Box, Heading, position, SimpleGrid, Stack, Text} from "@chakra-ui/react";

const Footer = () => {
    return (
      <Box minH={'40vh'} bg={'#2D3748'}>
          <SimpleGrid columns={4} spacing={10} p={4}>
              <Box bg="tomato" height="80px">
                  <Heading>Logo</Heading>
              </Box>
              <Box bg="tomato" height="80px" justifyContent={'center'}>
                  <Stack direction={'column'} align={'center'} alignItems={'center'} justifyContent={'center'}>
                      <Text>
                          Heading
                      </Text>     <Text>
                          Heading
                      </Text>     <Text>
                          Heading
                      </Text>
                  </Stack>
              </Box>
              <Box bg="tomato" height="80px"></Box>
              <Box bg="tomato" height="80px"></Box>
          </SimpleGrid>
      </Box>
    );
};

export default Footer;
